import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams, useLocation } from "react-router-dom"; // Import useLocation to get search query from header
import jsPDF from "jspdf"; // Import jsPDF
import './clientDeeds.css'; // Assuming you'll have a CSS file for styling deeds
import Header from "../header";
import Footer from "../../components_home/Home_Footer";

function ClientDeeds() {
    const { nic } = useParams(); // Get NIC from the URL params
    const [deeds, setDeeds] = useState([]);
    const [filteredDeeds, setFilteredDeeds] = useState([]); // For storing filtered deeds
    const [error, setError] = useState('');
    const location = useLocation(); // Get search query from header
    const searchQuery = new URLSearchParams(location.search).get("q") || ""; // Extract the search query

    useEffect(() => {
        // Fetch deeds by NIC
        const fetchDeeds = async () => {
            try {
                const response = await axios.get(`http://localhost:8070/deed/get_deeds_by_nic/${nic}`);
                setDeeds(response.data);
                filterDeeds(response.data); // Initial filter based on the search query
            } catch (err) {
                setError("Error fetching deeds. Please try again.");
                console.error(err);
            }
        };

        fetchDeeds();
    }, [nic]);

    // Function to filter deeds based on search query
    const filterDeeds = (deeds) => {
        if (searchQuery) {
            const filtered = deeds.filter(deed =>
                deed.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
                deed.deedType.toLowerCase().includes(searchQuery.toLowerCase()) ||
                deed.district.toLowerCase().includes(searchQuery.toLowerCase()) ||
                deed.division.toLowerCase().includes(searchQuery.toLowerCase())
            );
            setFilteredDeeds(filtered);
        } else {
            setFilteredDeeds(deeds); // If no search query, show all deeds
        }
    };

    // Call the filterDeeds function whenever the search query changes
    useEffect(() => {
        filterDeeds(deeds);
    }, [searchQuery, deeds]);

    // Function to generate a PDF report of deeds
    const generatePDF = () => {
        const doc = new jsPDF();

        doc.setFontSize(18);
        doc.text("Client Deeds Report", 14, 22);
        doc.setFontSize(12);

        filteredDeeds.forEach((deed, index) => {
            doc.text(`${index + 1}. Title: ${deed.title}`, 14, 30 + (index * 10));
            doc.text(`   Type: ${deed.deedType}`, 14, 35 + (index * 10));
            doc.text(`   District: ${deed.district}`, 14, 40 + (index * 10));
            doc.text(`   Division: ${deed.division}`, 14, 45 + (index * 10));
        });

        doc.save("Client_Deeds_Report.pdf");
    };

    return (
        <div className="client-deeds-container">
            <Header />
            <div className="deeds-content">
                <h1>Client Deeds</h1>
                {error && <p className="error-message">{error}</p>}
                <button className="pdf-button" onClick={generatePDF}>Generate PDF Report</button>
                {filteredDeeds.length > 0 ? (
                    <table className="deeds-table">
                        <thead>
                            <tr>
                                <th>Title</th>
                                <th>Type</th>
                                <th>District</th>
                                <th>Division</th>
                            </tr>
                        </thead>
                        <tbody>
                            {filteredDeeds.map((deed, index) => (
                                <tr key={index}>
                                    <td>{deed.title}</td>
                                    <td>{deed.deedType}</td>
                                    <td>{deed.district}</td>
                                    <td>{deed.division}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    <p>No deeds found</p>
                )}
            </div>
            <Footer />
        </div>
    );
}

export default ClientDeeds;
